import React from 'react';
import { Grid } from '@material-ui/core';

const Nopage = (props) => {
  return (
    <Grid
	  container
	  direction="row"
	  justify="center"
	  alignItems="center">

	  <Grid item xs={5}>
	  	No existela pagina
	  </Grid>

    </Grid>
  )
}

export default Nopage;
